import React, { Component } from 'react';
import sunny from "../images/sunny.png";
import rainy from "../images/rainy.png";

class WeatherComp extends Component {

    constructor(props) {
        super(props);

        this.state = {
            high_temp: 100,
            low_temp: 0,
            day: "Monday",

        };
    }

    render() {

        return (

            <div class="container">
                <div class="row">
                    <div class="col-sm">
                        <img src={sunny}/>
                        <br/>
                        <b>this.state.high_temp</b>
                    </div>
                    <div class="col-sm">
                        <img src={rainy}/>
                    </div>
                </div>
            </div>

        );

    }

}

export default WeatherComp;
